    false,nt"url": null,nt"notes": "Digital Elevation Model (DEM) derived from
    the 2004 Chittenden bare earth LiDAR data. The pixel size of this layer is 3.2m,
    equal to the spacing of the filtered bare earth LiDAR point data. It was generated
    in a two step process: 1) loading all bare earth LiDAR points into an ArcGIS geodatabase
    terrain, 2) exporting the terrain to a raster dataset using natural neighbor interpolation.
    This layer has not been subjected to any quality control, nor has it been validated
    for accuracy. Elevation values over Lake Champlain are not valid.",nt"license_title":
